import React from 'react'
// import SmartToy from '@mui/icons-material/SmartToy';
// import Person from '@mui/icons-material/Person';
import './style.css';

const Message = ({ message , codeHtml}) => {
  const doc =document.getElementById('code') ; 
  doc.innerHTML = message.codeHtml ; 
  console.log(message.codeHtml)
  return (
    <>
      {message.isBot ? (
        <div className=" row bot">
          <div className=" col bot_msg">
            <span className="">
            <div id='code'>
              {/* {message.codeHtml} */}
            </div>
            
              {message.text}
            </span>
          </div>
          {/* ici mettre bot logo */}
          {/* <SmartToy/> */}
          {/* <i className="fas fa-desktop w-6 h-6 dark:text-white  rounded-full order-1" /> */}
        </div>
      ) : (
        <div className="user">
          <div className="col user_msg">
             <span className="">{message.text}</span>
          </div>
          {/* ici mettre user logo */}
          {/* <Person/> */}
          {/* <i className="fas fa-user w-6 h-6 dark:text-white  rounded-full order-1" /> */}
        </div>
      )}
    </>
  )
}

export default Message
